DROP TABLE IF EXISTS `ingenieros_modulos`;
CREATE TABLE `ingenieros_modulos` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ingenieros_id` int(10) unsigned NOT NULL,
  `modulos_id` int(10) unsigned NOT NULL,
  `principal` smallint(6) DEFAULT '0',
  `estado` smallint(6) DEFAULT '0',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `capacitado` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `ingenieros_modulos_ingenieros_id_foreign` (`ingenieros_id`),
  KEY `ingenieros_modulos_modulos_id_foreign` (`modulos_id`),
  CONSTRAINT `ingenieros_modulos_ingenieros_id_foreign` FOREIGN KEY (`ingenieros_id`) REFERENCES `ingenieros` (`id`) ON DELETE CASCADE,
  CONSTRAINT `ingenieros_modulos_modulos_id_foreign` FOREIGN KEY (`modulos_id`) REFERENCES `modulos` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=528 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

