DROP TABLE IF EXISTS `capacidades_modulos`;
CREATE TABLE `capacidades_modulos` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `capacidades_id` int(11) unsigned DEFAULT NULL,
  `modulos_id` int(11) unsigned DEFAULT NULL,
  `nivel` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `fk_modulos_capa_idx` (`modulos_id`),
  KEY `fk_cap_mod_capa_idx` (`capacidades_id`),
  CONSTRAINT `fk_cap_mod_capa` FOREIGN KEY (`capacidades_id`) REFERENCES `capacidadesespecificas` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_modulos_capa` FOREIGN KEY (`modulos_id`) REFERENCES `modulos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

